import React from 'react';
import s from './style.module.css';

console.log('#### Header:', s)

const HeaderBlock = () => {
  return (
    <>
      <div>
        <h1 className = {s.header}>Учите слово онлайн</h1>
        <p>Воспользуйтесь карточками для запоминания</p>
      </div>
    </>
  )
}

export default HeaderBlock;
